css:
atom-text-editor,
:host {
  background-color: #2b303b;
  color: #dee3ec;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #2b303b;
  color: #dee3ec;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #272b34;
  color: #dee3ec;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #dee3ec;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  color: #454a54;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #454a54;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #454a54;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: #454a54;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: #dee3ec;
}
atom-text-editor.is-focused .cursor,
:host(.is-focused) .cursor {
  border-color: #f8f8f0;
}
atom-text-editor.is-focused .selection .region,
:host(.is-focused) .selection .region {
  background-color: #3d4550;
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line,
:host(.is-focused) .line-number.cursor-line-no-selection,
:host(.is-focused) .line.cursor-line {
  background-color: #272b34;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #454a54;
}
atom-text-editor .wrap-guide,
atom-text-editor::shadow .wrap-guide {
  background-color: #393e46;
}
.comment {
  color: #6e7a94;
}
.string {
  color: #bcd42a;
}
.constant.numeric {
  color: #bcd42a;
}
.constant.language {
  color: #ff5d38;
}
.constant.character,
.constant.other {
  color: #ff5d38;
}
.keyword {
  color: #26a6a6;
}
.storage {
  color: #26a6a6;
}
.storage.type {
  color: #26a6a6;
}
.storage.type.jsdoc {
  color: #9aa2b4;
}
.entity.name.class {
  text-decoration: underline;
  color: #ff5d38;
}
.entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #ff5d38;
}
.entity.name.function {
  color: #bcd42a;
}
.variable.parameter {
  font-style: italic;
}
.entity.name.tag {
  color: #26a6a6;
}
.entity.other.attribute-name {
  color: #ff5d38;
}
.support.function {
  color: #ff5d38;
}
.support.constant {
  color: #ff5d38;
}
.support.type,
.support.class {
  font-style: italic;
  color: #ff5d38;
}
.invalid {
  color: #f8f8f0;
  background-color: #00a8c6;
}
.invalid.deprecated {
  color: #f8f8f0;
  background-color: #00a8c6;
}
.meta.structure.dictionary.json .string.quoted.double.json {
  color: #bcd42a;
}
.meta.diff,
.meta.diff.header {
  color: #e6db74;
}
.markup.deleted {
  color: #00a8c6;
}
.markup.inserted {
  color: #a6e22e;
}
.markup.changed {
  color: #e6db74;
}
.constant.numeric.line-number.find-in-files:not(.match) {
  color: rgba(143, 190, 0, 0.63);
}
.entity.name.filename.find-in-files {
  color: #e6db74;
}
.keyword.other {
  color: #8998b9;
}
.meta.property-value,
.support.constant.property-value,
.constant.other.color {
  color: #bcd42a;
}
.meta.structure.dictionary.json .string.quoted.double.json {
  color: #ff5d38;
}
.meta.structure.dictionary.json .string.quoted.double.json .punctuation.begin,
.meta.structure.dictionary.json .string.quoted.double.json .punctuation.end {
  color: #ff5d38;
}
.meta.structure.dictionary.value.json .string.quoted.double.json {
  color: #bcd42a;
}
.meta.structure.dictionary.value.json .string.quoted.double.json .punctuation.begin,
.meta.structure.dictionary.value.json .string.quoted.double.json .punctuation.end {
  color: #bcd42a;
}
.meta.property-value .punctuation.separator.key-value {
  color: #dee3ec;
}
.keyword.other.use,
.keyword.other.function.use,
.keyword.other.namespace,
.keyword.other.new,
.keyword.other.special-method,
.keyword.other.unit,
.keyword.other.use-as {
  color: #26a6a6;
}
.meta.use .support.class.builtin,
.meta.other.inherited-class .support.class.builtin {
  color: #dee3ec;
}
.variable.parameter.function.coffee {
  font-style: italic;
  color: #bcd42a;
}
.entity.name.section.markdown {
  color: #ff5d38;
}
.punctuation.definition.heading.markdown {
  color: #26a6a6;
}
.markup.raw.inline.markdown {
  color: #bcd42a;
}
.punctuation.definition.bold.markdown,
.punctuation.definition.italic.markdown {
  color: #26a6a6;
}
.punctuation.definition.string.begin.markdown,
.punctuation.definition.string.end.markdown {
  color: #26a6a6;
}
.punctuation.definition.metadata.markdown {
  color: #26a6a6;
}
.markup.underline.link.markdown,
.markup.underline.link.image.markdown,
.meta.image.inline.markdown {
  font-style: italic;
  color: #26a6a6;
}
.markup.bold.markdown,
.markup.italic.markdown {
  color: #26a6a6;
}
.markup.italic.markdown {
  font-style: italic;
}
.markup.bold.markdown {
  font-weight: bold;
}
.markup.raw.block.markdown {
  color: #00a8c6;
}
.markup.deleted.git_gutter {
  color: #e61f44;
}
.markup.inserted.git_gutter {
  color: git-green;
}
.markup.changed.git_gutter {
  color: #f7b83d;
}
.entity.other.attribute-name.class.css {
  color: #bcd42a;
}
.embedded.js.source {
  color: #f7b83d;
}
